import React from 'react';
import './Guideslist.css';
import Navbar from './Navbar';

const images = [
    { src: require('../images/apexlegends.png'), },
    { src: require('../images/callofdutywarzone.png'), },
    { src: require('../images/counterstrike2.png'), },
    { src: require('../images/fortnite.png'), },
    { src: require('../images/leagueoflegends.png'), },
    { src: require('../images/overwatch2.png'), },
    { src: require('../images/rainbowsixsiege.png'), },
    { src: require('../images/rocketleague.png'), },
    { src: require('../images/valorant.png'), },
];

const Guideslist = () => {
    return (
        <div>
            <Navbar />
            <div className="guides-list">
                {images.map((image, index) => (
                    <div key={index} className="guide-item">
                        <div className="overlay-container">
                            <img src={image.src} alt={image.title} />
                            <div className="overlay">
                                <h3>{image.title}</h3>
                            </div>
                        </div>
                        <p>{image.title}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Guideslist;
